import React from 'react';

const Calculator = () => {
    const operators = ['-', '+', 'x', 'รท', '='];
    return (
        <div className='calculator'>
            <div className='display'/>
            <div className='keypad'>
                <button>0</button>
                <button>1</button>
                <button>2</button>
                <button>3</button>
                <button>4</button>
                <button>5</button>
                <button>6</button>
                <button>7</button>
                <button>8</button>
                <button>9</button>
                {operators.map(operator => (
                    <button key={operator} className='key'>
                        {operator}
                    </button>
                ))}
            </div>
        </div>
    );
}

export default Calculator;
